import React from 'react';

const Login = () => {
    return (
        <form onSubmit = {onSubmit}>
        <h1>Login User</h1>
     
        <div className='from-group'>
          <label>Enter Email</label>
          <input
            className='form-control'
            type='email'
            name='email'
            value={email}
            onChange={onChange}
          />
        </div>
        <div className='from-group'>
          <label>Enter Password</label>
          <input
            className='form-control'
            type='password'
            name='password'
            value={password}
            onChange={onChange}
          />
        </div>
    
          <input
          type='submit'
          value='Login User'
          className='btn btn-success'
        />
      
      
      </form>
    );
};

export default Login;
